          author: 'Cal',
        //   date: new Date(2022, 11, 9),
          post: "Stuff stuff"
        },
        {
          id: 4,
          title: 'Post 4',
          author: 'Cal',
        //   date: new Date(10, 1, 2022),
          post: "Another post."
        }
    ]

    return (
        <div>
            {/* <Nav /> */}
            <h1>Home Page</h1>
            <AllPosts items={blogPosts} />
        </div>
    )
}

export default Home;
